import React from 'react';

const Background = ({ children }) => {
    return (
        <div className="min-h-screen bg-gradient-to-br from-blue-900 via-purple-900 to-indigo-900 relative overflow-hidden">
            {/* Animated background elements */}
            <div className="absolute inset-0">
                <div className="absolute top-20 left-10 w-72 h-72 bg-blue-500 rounded-full mix-blend-multiply filter blur-xl opacity-20 animate-pulse"></div>
                <div className="absolute top-40 right-10 w-72 h-72 bg-purple-500 rounded-full mix-blend-multiply filter blur-xl opacity-20 animate-pulse delay-1000"></div>
                <div className="absolute bottom-20 left-1/2 transform -translate-x-1/2 w-80 h-80 bg-pink-500 rounded-full mix-blend-multiply filter blur-xl opacity-20 animate-pulse delay-2000"></div>
            </div>

            {/* Geometric patterns */}
            <div className="absolute inset-0 opacity-10">
                <div className="absolute top-1/4 left-1/4 w-2 h-2 bg-white rounded-full animate-ping"></div>
                <div className="absolute top-3/4 right-1/4 w-1 h-1 bg-white rounded-full animate-ping delay-500"></div>
                <div className="absolute top-1/2 left-3/4 w-3 h-3 bg-white rounded-full animate-ping delay-1000"></div>
            </div>

            {/* Top Menu Bar */}
            <nav className="relative z-10 bg-white/10 backdrop-blur-md border-b border-white/20">
                <div className="container mx-auto px-6 py-4">
                    <div className="flex items-center justify-between">
                        {/* Logo */}
                        <div className="flex items-center space-x-3">
                            <div className="w-10 h-10 bg-gradient-to-br from-blue-400 to-purple-500 rounded-lg flex items-center justify-center shadow-lg">
                                <svg className="w-6 h-6 text-white" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M13 10V3L4 14h7v7l9-11h-7z" />
                                </svg>
                            </div>
                            <div>
                                <h1 className="text-xl font-bold text-white">AppName</h1>
                                <p className="text-xs text-gray-300">Your Digital Solution</p>
                            </div>
                        </div>

                        {/* Menu Items */}
                        <div className="hidden md:flex items-center space-x-8">
                            <a href="#" className="text-white/80 hover:text-white transition-colors text-sm font-medium">Home</a>
                            <a href="#" className="text-white/80 hover:text-white transition-colors text-sm font-medium">About</a>
                            <a href="#" className="text-white/80 hover:text-white transition-colors text-sm font-medium">Services</a>
                            <a href="#" className="text-white/80 hover:text-white transition-colors text-sm font-medium">Contact</a>
                        </div>

                        {/* Right side info */}
                        <div className="flex items-center space-x-4">
                            <div className="hidden md:block text-right">
                                <p className="text-white text-sm font-semibold">24/7 Support</p>
                                <p className="text-gray-300 text-xs">+1 (555) 123-4567</p>
                            </div>
                            <div className="w-8 h-8 bg-white/20 rounded-full flex items-center justify-center">
                                <svg className="w-4 h-4 text-white" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 5a2 2 0 012-2h3.28a1 1 0 01.948.684l1.498 4.493a1 1 0 01-.502 1.21l-2.257 1.13a11.042 11.042 0 005.516 5.516l1.13-2.257a1 1 0 011.21-.502l4.493 1.498a1 1 0 01.684.949V19a2 2 0 01-2 2h-1C9.716 21 3 14.284 3 6V5z" />
                                </svg>
                            </div>
                        </div>
                    </div>
                </div>
            </nav>

            {/* Main Content Area */}
            <div className="relative z-10 flex items-center justify-center min-h-[calc(100vh-80px)] px-6 py-12">
                <div className="w-full max-w-md">
                    {/* Glass morphism effect for form container */}
                    <div className="bg-white/5 backdrop-blur-xl rounded-2xl border border-white/20 shadow-2xl p-1">
                        {children}
                    </div>
                </div>
            </div>

            {/* Bottom decorative elements */}
            <div className="absolute bottom-0 left-0 right-0 h-32 bg-gradient-to-t from-black/20 to-transparent pointer-events-none"></div>

            {/* Floating particles */}
            <div className="absolute inset-0 overflow-hidden pointer-events-none">
                <div className="absolute animate-float-slow top-1/4 left-1/5 w-4 h-4 bg-white/20 rounded-full"></div>
                <div className="absolute animate-float-medium top-1/3 right-1/4 w-2 h-2 bg-white/30 rounded-full"></div>
                <div className="absolute animate-float-fast top-2/3 left-1/3 w-3 h-3 bg-white/10 rounded-full"></div>
                <div className="absolute animate-float-slow bottom-1/4 right-1/5 w-5 h-5 bg-white/15 rounded-full"></div>
            </div>

            <style jsx>{`
        @keyframes float-slow {
          0%, 100% { transform: translateY(0px) rotate(0deg); }
          50% { transform: translateY(-20px) rotate(180deg); }
        }
        @keyframes float-medium {
          0%, 100% { transform: translateY(0px) rotate(0deg); }
          50% { transform: translateY(-15px) rotate(90deg); }
        }
        @keyframes float-fast {
          0%, 100% { transform: translateY(0px) rotate(0deg); }
          50% { transform: translateY(-10px) rotate(270deg); }
        }
        .animate-float-slow { animation: float-slow 6s ease-in-out infinite; }
        .animate-float-medium { animation: float-medium 4s ease-in-out infinite; }
        .animate-float-fast { animation: float-fast 3s ease-in-out infinite; }
        .delay-1000 { animation-delay: 1s; }
        .delay-2000 { animation-delay: 2s; }
      `}</style>
        </div>
    );
};

export default Background;
